script: |
  super -f text -I q8191.spq | sort > q8191.out

inputs:
  - name: q8191.spq
    data: |
      SELECT DISTINCT - ( tab1.col2 ) + + ( - 0 ) AS col0 FROM tab1 (FORMAT parquet), tab0 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q8191.out
    data: |
      -54
      -57
      -96
